import React, { useState } from "react";
import Logo from "../../../assets/images/logo.png";
import "bootstrap/dist/css/bootstrap.min.css";
import Tittle from "./componentes/tittles/Tittle";
import { Input } from "react-bootstrap";
import "./styles.scss";

const FormLogin = ({ CambiarEstado }) => {
  const [user, setUser] = useState("");
  const [password, setPassword] = useState("");

  return (
    <div className="form">
      <img src={Logo} className="form__logo" />
      <form className="form__container">
        <h2 className="form__container--title">Inicio de Sesión</h2>
        <div className="form__container--input-container form-group">
          <label className="icon-usuario">
            <img src="https://img.icons8.com/wired/25/000000/change-user-male.png" />
          </label>
          <Input
            className="form__container--input-container--input"
            placeholder="Usuario"
            type="text"
            value={user}
            onChange={(e) => {
              console.log({ user });
              setUser(e.target.value);
            }}
          />
          <input
            className="form__container--input-container--input"
            placeholder="Contraseña"
            type="password"
            value={password}
            onChange={(e) => {
              console.log({ password });
              setPassword(e.target.value);
            }}
          />
        </div>
        <button
          onClick={CambiarEstado}
          className="btn form__container--button btn-primary"
        >
          Iniciar sesión
        </button>
      </form>
    </div>
  );
};

export default FormLogin;
